import { ScoreBoard } from '../ScoreBoard/ScoreBoard'
import {GrPrevious , GrNext} from 'react-icons/gr'
import './InGame.scss'
import { Component } from 'react'
export class InGame extends Component {
  constructor() {
    super();
    this.state = {
      currentQuestion: {},
      questions: []
    }
  }


  render () {
    return (
      <main className="in-game">
        <GrPrevious/>
        <QuestionSlide/>
        <GrNext/>
        <ScoreBoard/>
      </main>
    )
  }
}
